import React, { Component } from "react";
import { View } from "@/components/flexView";
import { Icon } from "antd";
import styles from "./index.css";

import EnvironmentTest from './components/environmentTest'
import ParamConfig from './components/paramConfig'
import InstallFinish from './components/installFinish'


export default class App extends Component {
    state = {
        current: 1
    }
    changeState = (current) => {
        this.setState({ current })
    }

    render() {
        const { current } = this.state
        const testList = [
            {
                id: 1,
                title: '环境检测',
                renderView: () => <EnvironmentTest {...this.props} changeState={this.changeState} />
            }, {
                id: 2,
                title: '设置账户',
                renderView: () => <ParamConfig {...this.props} changeState={this.changeState} />
            }, {
                id: 3,
                title: '安装完成',
                renderView: () => <InstallFinish {...this.props} />
            }
        ]
        return (
            <View className={styles.indexWarp}>
                <View className={styles.topView}>
                    <img
                        alt='logo'
                        src={logobase}
                    />
                    <a
                        target="fashop_index"
                        href='https://www.fashop.cn/'
                    >
                        FaShop官网 →
                    </a>
                </View>
                <View className={styles.contentView}>
                    <View className={styles.titleView}>
                        {
                            testList.map((item, index) =>
                                <View key={index}>
                                    <p
                                        key={index}
                                        style={current >= item.id ? { color: '#fff' } : { color: '#6d6d6d' }}
                                    >
                                        {item.title}
                                    </p>
                                    {current === item.id ? <Icon
                                        type="caret-up"
                                        style={{
                                            color: '#fff',
                                        }}
                                    /> : null}
                                </View>
                            )
                        }
                    </View>
                    <View className={styles.currentView}>
                        {
                            testList[current - 1].renderView()
                        }
                    </View>
                </View>
                <View className={styles.footerView}>
                    <a
                        rel="noopener noreferrer"
                        target='_blank'
                        href='https://www.fashop.cn/'
                    >
                        FaShop官网
                    </a>
                    <p>
                        Powered by FaShop <Icon type="copyright" /> 2018-2099 www.fashop.cn</p>
                </View>
            </View>
        )
    }
}


 const logobase = 'data:image/png;base64,'

 const logo2base = 'data:image/png;base64,'
